export default function App() {
  const getEventData = async () => {
    const events = await getEvents()
    console.log(JSON.stringify(events))
  }

  return (
    <main>
      <button type="button" onClick={getEventData}>
        Hent Data
      </button>
      <button>

      </button>
    </main>
  )
}
